function JobDetails(props) {

    return (
    <>
      {props.jobs.map((item) => {
        return (
          <div>
            <h1>{item.title}</h1>
            <h3>{item.id}</h3>
          </div>
        );
      })}
    </>
  );
}

export default JobDetails;
